import React, { useState, useEffect } from 'react';
import './Ingredients.css'; // Стилі можна імпортувати у ваш JSX

const Ingredients = () => {
    const [ingredients, setIngredients] = useState([]);
    const [ingredient, setIngredient] = useState({ id: '', name: '', caloriesPerGram: '' });

    useEffect(() => {
        fetch('/ingredients')
            .then(response => response.json())
            .then(data => setIngredients(data));
    }, []);

    const handleSubmit = event => {
        event.preventDefault();
        fetch('/ingredients', {
            method: 'POST',
            headers: {
                'Content-Type': 'application/json'
            },
            body: JSON.stringify(ingredient)
        })
            .then(response => response.json())
            .then(data => {
                setIngredients([...ingredients, data]);
                setIngredient({ id: '', name: '', caloriesPerGram: '' });
            });
    };

    const handleDelete = id => {
        fetch(`/ingredients/${id}`, {
            method: 'DELETE'
        }).then(() => {
            setIngredients(ingredients.filter(ing => ing.id !== id));
        });
    };

    return (
        <div className="container">
            <h2>Інгредієнти</h2>
            <table id="ingredientsTable">
                <thead>
                <tr>
                    <th>ID інгредієнта</th>
                    <th>Назва інгредієнта</th>
                    <th>Калорійність (ккал/г)</th>
                </tr>
                </thead>
                <tbody>
                {ingredients.map(ingredient => (
                    <tr key={ingredient.id}>
                        <td>{ingredient.id}</td>
                        <td>{ingredient.name}</td>
                        <td>{ingredient.caloriesPerGram}</td>
                        <td>
                            <button onClick={() => handleDelete(ingredient.id)}>Видалити</button>
                        </td>
                    </tr>
                ))}
                </tbody>
            </table>
            <div className="form-section">
                <h3>Додати інгредієнт</h3>
                <form onSubmit={handleSubmit}>
                    <input
                        type="number"
                        name="id"
                        value={ingredient.id}
                        placeholder="ID Інгредієнта"
                        required
                        onChange={e => setIngredient({ ...ingredient, id: e.target.value })}
                    />
                    <input
                        type="text"
                        name="name"
                        value={ingredient.name}
                        placeholder="Назва Інгредієнта"
                        required
                        onChange={e => setIngredient({ ...ingredient, name: e.target.value })}
                    />
                    <input
                        type="number"
                        step="0.01"
                        name="caloriesPerGram"
                        value={ingredient.caloriesPerGram}
                        placeholder="Калорійність (ккал/г)"
                        required
                        onChange={e => setIngredient({ ...ingredient, caloriesPerGram: e.target.value })}
                    />
                    <button type="submit">Додати інгредієнт</button>
                </form>
            </div>
            <a href="main.html" className="back-link">Повернутися на головну</a>
            <div className="footer">
                Автор роботи: Гончаренко Володимир з групи АІ-221
            </div>
        </div>
    );
};

export default Ingredients;
